import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
function DataComponent({mail}) {
    return (
        <div>
            <Link to="/data"></Link>
            <p>{mail}</p>
        </div>
    )
}

export default DataComponent
